/// along with corresponding ZK proofs and Schnorr signatures.
///
/// `DarkLeaf` is used to map relations between contract calls in the transaction.
#[derive(Clone, Default, Eq, PartialEq, SerialEncodable, SerialDecodable)]
pub struct Transaction { /// Calls executed in this transaction pub calls: Vec<DarkLeaf<ContractCall>>, /// Attached ZK proofs pub proofs: Vec<Vec<Proof>>, /// Attached Schnorr signatures pub signatures: Vec<Vec<Signature>>,
} Function calls represent mutations of the current active state to a new state. /// A ContractCall is the part of a transaction that executes a certain
/// `contract_id` with `data` as the call's payload.
#[derive(Clone, Eq, PartialEq, SerialEncodable, SerialDecodable)]
pub struct ContractCall { /// ID of the contract invoked pub contract_id: ContractId, /// Call data passed to the contract pub data: Vec<u8>,
} The contract_id corresponds to the top level module for the contract which includes the global State. The func_id of a function call corresponds to predefined objects in the submodules: Builder creates the anonymized CallData. Ran by the prover. CallData is the parameters used by the anonymized function call invocation. Verifiers have this. process() that runs the function call on the current state using the CallData. apply() commits the update to the current state taking it to the next state. An example of a contract_id could represent DAO or Money. Examples of func_id could represent DAO::mint() or Money::transfer(). Each function call invocation is ran using its own process() function. mod dao_contract { ... // DAO::mint() in the smart contract pseudocode mod mint { ... fn process(states: &StateRegistry, func_call_index: usize, parent_tx: &Transaction) -> Result<Update> { // we could also change the process() function signature // so we pass the func_call itself in let func_call = parent_tx.func_calls[func_call_index]; let call_data = func_call.call_data; // It's useful to have the func_call_index within parent_tx because // we might want to enforce that it appears at a certain index exactly. // So we know the tx is well formed. ... } }
