} The transaction verification pipeline roughly looks like this: Loop through all function call invocations within the transaction: Lookup their respective process() function based off their contract_id. The contract_id and func_id corresponds to the contract and specific function, such as DAO::mint(). Call the process() function and store the update. Halt if this function fails. Loop through all updates Lookup specific apply() function based off the contract_id and func_id. Call apply(update) to finalize the change.

