Another downside of this model is that state changes at the site of invocation are not immediate. Currently in DarkFi, we separate contract calls into 2-phases: process() which verifies the calldata, and update() which takes a state update from process() and writes the changes. Host functions have permissions: process() is READONLY, which means state can only be read. For example it can use db_get() but not db_set(). update() is WRITEONLY. It can only write to the state. For example it can use db_set() but not db_get(). Let A, B be smart contract functions. A calls invoke(B). The normal flow in Ethereum would be: process(A) -> invoke(B) -> process(B) -> update(B) ->
update(A) However with the model described, instead would be: process(B) ->
update(B) ->
process(A) ->
update(A) which simulates the previous trace. State changes occur linearly after all process() calls have passed successfully. NOTE: we can iterate depth first through the tree to simulate the normal calling pattern. An upside of this strict separation, is that it makes reentrancy attacks impossible. Say for example we have this code: contract VulnerableContract { function withdraw(amount) { // ... sender.call(amount); balances[sender] -= amount; }
} contract AttackerContract { function receive(amount) { if balance(VulnerableContract) >= 1 { VulnerableContract.withdraw(1); } }
} The main recommended way to mitigate these attacks is using the 'checks-effects-interactions' pattern [1] [2] . whereby the code is delineated into 3 strict parts. contract ChecksEffectsInteractions { // ... function withdraw(uint amount) public { require(balances[msg.sender] >= amount); balances[msg.sender] -= amount; msg.sender.transfer(amount); }
} Interactions always occur last since they cause unknown effects. Performing logic based off state changes from an interacting outside contract (especially when user provided) is very risky. With the model of invoke() given above, we do not have any possibility of such an attack occurring.

