} Once that's done, we'll need to create a ProtocolDchat constructor that we will pass to the ProtocolRegistry to register our protocol. We'll invoke the MessageSubsystem and add DchatMsg as to the list of dispatchers. Next, we'll create a MessageSubscription to DchatMsg using the method subscribe_msg. We'll also initialize the ProtocolJobsManager and finally return a pointer to the protocol. impl ProtocolDchat { pub async fn init(channel: net::ChannelPtr, msgs: DchatMsgsBuffer) -> net::ProtocolBasePtr { debug!(target: "dchat", "ProtocolDchat::init() [START]"); let message_subsytem = channel.message_subsystem(); message_subsytem.add_dispatch::<DchatMsg>().await; let msg_sub = channel.subscribe_msg::<DchatMsg>().await.expect("Missing DchatMsg dispatcher!"); Arc::new(Self { jobsman: net::ProtocolJobsManager::new("ProtocolDchat", channel.clone()), msg_sub, msgs, }) } We're nearly there. But right now the protocol doesn't actually do anything. Let's write a method called handle_receive_msg which receives a message on our MessageSubscription and adds it to DchatMsgsBuffer. Put this inside the ProtocolDchat implementation: async fn handle_receive_msg(self: Arc<Self>) -> Result<()> { debug!(target: "dchat", "ProtocolDchat::handle_receive_msg() [START]"); while let Ok(msg) = self.msg_sub.receive().await { let msg = (*msg).to_owned(); self.msgs.lock().await.push(msg); } Ok(()) } As a final step, let's add that task to the ProtocolJobManager that is invoked in start: async fn start(self: Arc<Self>, executor: Arc<Executor<'_>>) -> Result<()> { debug!(target: "dchat", "ProtocolDchat::ProtocolBase::start() [START]"); self.jobsman.clone().start(executor.clone()); self.jobsman.clone().spawn(self.clone().handle_receive_msg(), executor.clone()).await; debug!(target: "dchat", "ProtocolDchat::ProtocolBase::start() [STOP]"); Ok(()) }

